import "../blocks/Footer.css";

export default function Footer() {
  return (
    <div className="footer__container">
      <div className="socials__button-container">
        <button className="facebook__button">FB</button>
        <button className="instagram__button">IG</button>
        <button className="github__button">Git</button>
      </div>
    </div>
  );
}
